import React from 'react';


function NavBar(){
    return(
        <nav className="dt w-100 border-box pa3 ph5-ns bg-light-blue ">
            <a className="dtc v-mid mid-gray link dim w-25" href="#" title="Home">
                <img src="https://png.pngtree.com/element_pic/17/07/24/d46491b49387e3ea4495df1996473764.jpg" className="dib w2 h2 br-100" alt="Site Name"/>
            </a>
            <div className="dtc v-mid w-75 tr">
                <a className="link dim dark-gray f6 f5-ns dib mr3 mr4-ns" href="#">Add new Book</a>
                <a className="link dim dark-gray f6 f5-ns dib mr3 mr4-ns" href="#" title="Store">My books</a>
                <a className="link dim dark-gray f6 f5-ns dib" href="#" title="Contact">Books to read</a>
            </div>
        </nav>
    );
}

export default NavBar;
